    /**
     * Gets the attribute value for the calculated attribute TransStatus.
     * @return the TransStatus
     */
    public String getStatusFromCode(String code) {
        String status = null;
        if (code != null) {
            if ("D".equals(code)) {
                status = "Draft";
            } else if ("I".equals(code)) {
                status = "Pending Approval";
            } else if ("A".equals(code)) {
                status = "Approved";
            } else if ("R".equals(code)) {
                status = "Rejected";
            } else if ("S".equals(code)) {
                status = "Submitted";
            } else if ("CL".equals(code)) {
                status = "Cancelled";
            } else if ("P".equals(code)) {
                status = "Posted";
            } else if ("RV".equals(code)) {
                status = "Reversed";
            } else if ("L".equals(code)) {
                status = "Loaded";
            } else if ("E".equals(code)) {
                status = "Exported";
            } else if ("AC".equals(code)) {
                status = "Active";
            }
        }

        return status;
    }

