    public BigDecimal getTransAbsoluteErrorPercentage() {
        BigDecimal absErrorPer = new BigDecimal(0.0);
        try {
            if (getCandyBOQLinesVO().first() != null) {
                Double candyTotCostBud =
                    Double.parseDouble(getCandyBOQLinesVO().first().getAttribute("TransCandyNetFinalAmntTotal") !=
                                       null ?
                                       getCandyBOQLinesVO().first().getAttribute("TransCandyNetFinalAmntTotal").toString() :
                                       "0");
                Double fussTotCostbud =
                    Double.parseDouble(getCandyBOQLinesVO().first().getAttribute("TransNetFinalAmountTotal") !=
                                       null ?
                                       getCandyBOQLinesVO().first().getAttribute("TransNetFinalAmountTotal").toString() :
                                       "1");
                if (candyTotCostBud != null && fussTotCostbud != null &&
                    candyTotCostBud != 0 && fussTotCostbud != 0) {
                    absErrorPer =
                            new BigDecimal(getDiffPercentageFrom(candyTotCostBud,
                                                                 fussTotCostbud));
                }

            }
        } catch (Exception e) {
            return null;
        }
        return absErrorPer;
        //        return (BigDecimal) getAttributeInternal(TRANSABSOLUTEERRORPERCENTAGE);
    }

